Japan Top 10 is a show where we give you and play the top 10 J-Pop hits played by the Japanese radio stations! The show will be done in complete English and we'll do our best to keep the talking to a minimum! This show will be released right here on iTunes or Hipcast. A regular Japan Top 10 Countdown is released on a bi-weekly basis on Tuesdays. Summer special countdowns will be released on every other week that a regular countdown is not released and also on Tuesdays.&#13;
&#13;
Feedback about this show can be left at info@jtop10.jp. We also love to take your request about any Japanese hits you want us to play, email us at the same email (info@jtop10.jp) and we'll do our best to put it on the next countdown! &#13;
&#13;
Finally, make sure you visit our website at  http://jtop10.jp for more awesome stuff!

