Just Food Stories is a collection of conversations with people who are changing the way we eat and helping to create a food system that is more accessible, healthier and more sustainable. From policy makers to teachers and authors to community gardeners, we'll meet people who are making change and who will inspire others through their stories to make change as well. Just Food is a non-profit organization all about helping people  build community food projects and Just Food Stories is our way of spreading the message that there is good news and a movement afloat. Our stories will introduce listeners to some people who used their passions and skills to bring change. Hopefully their stories will inspire others  to create their own Just Food Story&#xD;
&#xD;
&#xD;
&#xD;
Jacquie Berger is the Executive Director of Just Food, a NYC nonprofit that connects farmers and communities with the resources and support they need to make fresh, healthy, locally grown food accessible to all. Since 2006, she has led Just Food's growth - diversifying programs and increasing community representation and reach. Previously, Jacquie managed community gardening and urban greening programs at the Knox Parks Foundation in Hartford, CT and was the Director of the Holcomb Farm Environmental Learning Center, where she developed environmental and agricultural education. She lives with her family in Clinton Hill, Brooklyn and belongs to the Clinton Hill CSA.&#xD;
&#xD;
Alison Cayne is founder of Haven&#x2019;s Kitchen, a cooking school, specialty food shop and event space in Manhattan. Since 2009, Ali has been educating people about the connection between eating and agriculture and working towards her Masters in NYU&#x2019;s Food Studies program. Ali is on the boards of Just Food, Edible Schoolyard NYC and FERN and regularly contributes to Huffington Post, USA Today and Domino Magazine. Cayne is giving a TedX Manhattan talk in March on coalescence in the food movement and lives with her five children in Greenwich Village.&#xD;

Where else can you find the dad from "Silver Spoons," the lead singer of Wang Chung and the creator of "MadLibs"...all in one place? Welcome to Just My Show, the retro pop culture podcast. Our job is to bring you back to all those things you forgot you loved growing up. &#xD;
&#xD;
Just My Show brings you interviews with some of your all time favorite people from classic TV, movies, sports and a whole lot more. (We love jogging your memory by throwing in some more obscure stuff too!) &#xD;
&#xD;
So take a quick break from that boring day job or add some familiar old friends to that morning commute. Wherever you are, just sit back and enjoy. &#xD;
&#xD;
This isn't rocket science...it's Just My Show.

